import React from "react";
import styles from './Card.module.css';


const Card = () => {
    return (
        <div className={styles.card}>
             <img 
               src="https://via.placeholder.com/150"
               alt="Album Cover"
               className={styles.albumImage}
               
               />
           </div>
    )

}

export default Card
